app.post("/api/search", zValidator("json", SearchRequestSchema), async (c2) => {
  const { query, language = "en", category } = c2.req.valid("json");
  const startTime = Date.now();
  const db = c2.env.DB;
  const openai = new OpenAI({
    apiKey: c2.env.OPENAI_API_KEY
  });
  try {
    let sql = `
      SELECT * FROM knowledge_entries 
      WHERE (
        content_text LIKE ? OR 
        functionality LIKE ? OR 
        description LIKE ? OR
        user_questions_en LIKE ? OR
        user_questions_pt LIKE ?
      )
    `;
    const searchTerm = `%${query}%`;
    const params = [searchTerm, searchTerm, searchTerm, searchTerm, searchTerm];
    if (category) {
      sql += " AND category = ?";
      params.push(category);
    }
    sql += " ORDER BY feature_module ASC LIMIT 10";
    const result = await db.prepare(sql).bind(...params).all();
    const relevantEntries = result.results;
    if (relevantEntries.length === 0) {
      return c2.json({
        answer: language === "pt" ? "Desculpe, no encontrei informaes sobre isso na documentao do Modo Caverna." : "Sorry, I couldn't find information about that in the Modo Caverna documentation.",
        relevantEntries: [],
        responseTime: Date.now() - startTime
      });
    }
    const context = relevantEntries.map(
      (entry) => `Feature: ${entry.feature_module} - ${entry.functionality}
Description: ${entry.description}
UI Elements: ${entry.ui_elements || "N/A"}
Content: ${entry.content_text}
`
    ).join("\n---\n");
    const systemPrompt = language === "pt" ? `Voc  um assistente especializado na documentao do Modo Caverna. Responda perguntas com base apenas nas informaes fornecidas. Seja claro, til e responda em portugus brasileiro. Se a informao no estiver disponvel, diga que no encontrou na documentao.` : `You are an assistant specialized in Modo Caverna documentation. Answer questions based only on the provided information. Be clear, helpful, and respond in English. If information is not available, say you couldn't find it in the documentation.`;
    const userPrompt = language === "pt" ? `Com base na documentao do Modo Caverna abaixo, responda esta pergunta: "${query}"

Documentao:
${context}` : `Based on the Modo Caverna documentation below, answer this question: "${query}"

Documentation:
${context}`;
    const completion = await openai.chat.completions.create({
      model: "gpt-4o-mini",
      messages: [
        { role: "system", content: systemPrompt },
        { role: "user", content: userPrompt }
      ],
      temperature: 0.3,
      max_tokens: 500
    });
    const answer = completion.choices[0].message.content || (language === "pt" ? "No consegui gerar uma resposta." : "Could not generate a response.");
    const responseTime = Date.now() - startTime;
    await db.prepare(`
      INSERT INTO search_sessions (query, response, response_time_ms) 
      VALUES (?, ?, ?)
    `).bind(query, answer, responseTime).run();
    return c2.json({
      answer,
      relevantEntries,
      responseTime
    });
  } catch (error) {
    console.error("Search error:", error);
    return c2.json({
      answer: language === "pt" ? "Ocorreu um erro ao processar sua pergunta. Tente novamente." : "An error occurred while processing your question. Please try again.",
      relevantEntries: [],
      responseTime: Date.now() - startTime
    }, 500);
  }
});
